import React, { Component } from 'react';
import ServiesMember from './ServiesMember';
import Icon1 from './Icon1';
import Icon2 from './Icon2';
import Icon3 from './Icon3';
class Servies extends Component {
	constructor() {
		super();

		this.state = {
			serviesInfo: [
				{
					id: 1,
					h: <Icon1 />,
					text: 'lorem ipsum dolor sitbnconsectetur adipiscing elitlmkamet'
				},

				{
					id: 3,
					h: <Icon2 />,

					text: 'lorem ipsum dolor sitbnconsectetur adipiscing elitlmkamet'
				},

				{
					id: 2,
					h: <Icon3 />,
					text: 'lorem ipsum dolor sitbnconsectetur adipiscing elitlmkamet'
				}
			]
		};
		const mem = serviesInfo.map((sr) => <ServiesMember key={sr.id} text={sr.text} h={sr.h} />);}
	
	
	render() {
		return <div className="row">{mem}</div>;
	}
}
export default Servies;
